import React from "react";
import "./Navbar.css";

const Navbar = props => 
    (
        <div className = "navbar">
            <div className = "title">{props.children}</div>
            <div className = "scores">
            Score: {props.score} Highscore: {props.highscore}
            </div>
        </div>
    );

export default Navbar;
